import React from 'react';

function App() {
  let candidates = [
    '민식',
    '무현',
    '대중',
    '기철',
    '회영',
    '민솔',
    '성묵',
    '희선',
    '대희',
    '영미',
    '소영',
    '알라',
  ];
  const randomCandidates = candidates.sort((a, b) => {
    return parseInt(Math.random() * 10) - 5;
  });
  return <div>hi</div>;
}

export default App;
